",code:"// Key Colors view shows the main M3 color roles:\n\n// PRIMARY COLUMN\n// - Primary (main brand color)\n// - On Primary (text color on primary)\n// - Primary Container (light background)\n// - On Primary Container (text on container)\n\n// SECONDARY COLUMN\n// - Secondary (accent color)\n// - Secondary Container\n\n// TERTIARY COLUMN\n// - Tertiary (vibrant accent)\n// - Tertiary Container\n\n// SURFACE COLUMN\n// - Surface (main background)\n// - Surface Variant\n// - Outline (borders)\n// - Outline Variant"},{label:"Tonal Palettes View",language:"typescript",code:"// Tonal Palettes view shows all 18 tones for each palette\n// Useful for fine-grained control and accessibility checking\n\n// Each row shows tones from 100 (white) to 0 (black):\n// 100, 99, 98, 95, 90, 80, 70, 60, 50, 40, 35, 30, 25, 20, 15, 10, 5, 0\n\n// PALETTES:\n// - Primary (your seed color)\n// - Secondary (complementary)\n// - Tertiary (vibrant accent)\n// - Neutral (grays)\n// - Neutral Variant (tinted grays)\n// - Error (red tones)\n\n// Click any tone to copy its hex value"}];m3CopyStepTabs=[{label:"Export Options",language:"typescript",code:'// The code preview shows AegisX-compatible CSS variables\n// Two format options:\n\n// CSS Format (recommended for direct use):\n// [data-theme="custom"] {\n//   --ax-primary: #6750A4;\n//   --ax-brand-default: #6750A4;\n//   --ax-background-default: #FFFBFE;\n//   ...\n// }\n\n// SCSS Format (for SCSS projects):\n// $ax-primary: #6750A4;\n// $ax-brand-default: #6750A4;\n// $ax-background-default: #FFFBFE;\n// ...\n\n// Click the copy button to copy all variables'}];m3ApplyStepTabs=[{label:"Create Theme File",language:"scss",code:"// 1. Create a new theme file:\n// libs/aegisx-ui/src/lib/styles/themes/my-brand/_light.scss\n\n// 2. Paste the generated CSS variables:\n[data-theme='my-brand'],\n.theme-my-brand {\n  // PRIMARY / BRAND (from M3 export)\n  --ax-primary: #6750A4;\n  --ax-primary-light: #EADDFF;\n  --ax-primary-dark: #21005D;\n  --ax